function main()
	if not isSampLoaded() or not isSampfuncsLoaded() then return end
	while not isSampAvailable() do wait(80) end

	result_version = check_update(version_url)
	requestUpdate.v = result_version.result

	if not doesFileExist(pathOffLog) then 
		createDirectory(pathOffLog:match("(.*)\\.+%.txt$"))
		local offlog = io.open(pathOffLog, "a"); offlog:close()
		log("Создан файл для сохранения логов")
	end
	if loadConfig() then log("Настройки скрипта "..lc.."загружены!") end
	if loadCmd() then log("Команды скрипта "..lc.."загружены!") end
	if loadSounds() then log("Звуки оповещений "..lc.."загружены") end
	if isDeveloper() then log(yc .. "Режим разработчика!") end
	lua_thread.create(ajailThread)
	lua_thread.create(PrRenderThread)
	lua_thread.create(PrRenderDialog)
	lua_thread.create(clMarkerThread)
	lua_thread.create(bizOwnerIdThread)
	loadPatches()
	sampAddChatMessage(tag.."Скрипт готов к работе. Основное меню: "..lc.."/opra", mcx)

	while true do

		imgui.ShowCursor = ImOpra.v or changeLogWindow.v or requestUpdate.v
		imgui.Process = ImOpra.v or changeLogWindow.v or requestUpdate.v or AJTimer.v

		if not aAuth.state and (aAuth.timer == nil or (os.clock() - aAuth.timer) >= 10) then
			aAuth.attempt = aAuth.attempt + 1
			aAuth.timer = os.clock()
			aAuth.await = false

			if aAuth.attempt == aAuth.limit then
				log("Попытки проверки доступа к админке исчерпаны. Скрипт отключён")
				ImOpra.v, ErrorMessage = false, false
				wait(100); thisScript():unload()
				return
			else
				log(("Не удалось проверить доступ к админке. Попытка: %s/%s"):format(aAuth.attempt, aAuth.limit))
				aAuth.await = true
				sampSendChat("/flip")
			end
		end

	wait(0)
	end
end

function goHouse()
	if not tonumber(ajailStatus) then
		local blast, kbox, boxlast = getLastByed(1)
		if blast then
			if not tLog[kbox][5][1] then
				local jailcmd = getJailCmd(1, boxlast[4])
				if qAccept.v then
					getDialogQacc(jailcmd)
				else
					sampSendChat(jailcmd)
				end
				return
			end
		end
	else
		sampAddChatMessage(tag.."Ручной запрос не может быть выполнен, пока "..lc.."активен Авто-Режим", mcx)
		return
	end
	sampAddChatMessage(tag.."Никто не ловил бизнесы в последнее время :(", mcx)
end

