function ajail(sec)
	if ajailStatus ~= nil then 
		ajailStatus = nil
		sampAddChatMessage(tag.."Автоматический режим "..lc.."отключен!", mcx)
		return
	end
	if tonumber(sec) then 
		local sec = tonumber(sec)
		if sec >= 30 and sec <= 3599 then 
			ajailStatus, ajStart, tAjail = sec, os.time(), {}
			sampAddChatMessage(tag.."Автоматический режим включен до "..lc..os.date("%H:%M:%S", os.time() + sec).." ["..sec.." секунд]", mcx)
			sampAddChatMessage(tag.."Для ручного отключения введи команду ещё раз", mcx)
			return
		end
	end
	sampAddChatMessage(tag.."Используй: /ajail [ sec (30-3599) ]", mcx)
end

