function PrRenderThread()
	while not sampIsLocalPlayerSpawned() do wait(0) end
	while true do wait(0)
		if PrRender["state"].v then 
			PrX, PrY = PrRender["pos"]["x"].v, PrRender["pos"]["y"].v
			if aAuth.state then

				if tonumber(PrRender["await"]) then
					local rReasons = {
						[1] = "Ожидание выхода из авто",
						[2] = "Ожидание закрытия диалога",
						[3] = "Ожидание выхода из рекона"
					}
					renderFontDrawTextAlign(fontPr, "["..rReasons[PrRender["await"]].."]", PrX, PrY, 0xFFBE3D3D, PrRender["align"].v)
					PrY = PrY + PrRender["fontSize"].v + 10
				end

				renderFontDrawTextAlign(fontPr, "Бизнесы:", PrX, PrY, mcx, PrRender["align"].v)
				for k, v in ipairs(PrRender["bizs"]) do
					PrY = PrY + PrRender["fontSize"].v + 5
					renderFontDrawTextAlign(fontPr, string.format(lc.."№%s {FFFFFF}%s", v[1], v[2]), PrX, PrY, -1, PrRender["align"].v)
				end

				PrY = PrY + PrRender["fontSize"].v + 10

				renderFontDrawTextAlign(fontPr, "Дома:", PrX, PrY, mcx, PrRender["align"].v) 
				for k, v in ipairs(PrRender["houses"]) do
					PrY = PrY + PrRender["fontSize"].v + 5
					renderFontDrawTextAlign(fontPr, string.format(lc.."№%s", v[1]), PrX, PrY, -1, PrRender["align"].v)
				end
			else
				renderFontDrawTextAlign(fontPr, lc.."ROZOV OPROCHKI: Недвижимость", PrX, PrY, 0x70FFFFFF, PrRender["align"].v)
				PrY = PrY + PrRender["fontSize"].v + 5
				renderFontDrawTextAlign(fontPr, mc.."Ожидание авторизации в /apanel", PrX, PrY, 0x70FFFFFF, PrRender["align"].v)
				PrY = PrY + PrRender["fontSize"].v + 5
				renderFontDrawTextAlign(fontPr, mc.."Это может занимать до 15 сек", PrX, PrY, 0x70FFFFFF, PrRender["align"].v)
			end
		end
	end
end

function getRandomDelay(dmin, dmax)
	math.randomseed(os.clock())
	return math.random(dmin, dmax)
end

function se.onServerMessage(clr, msg)
-->> HOUSES BLOCK | Nick_Name [777] купил дом ID: 123 по гос. цене за 2.28 ms!
	local hPl, hId, hTm = msg:match("^([a-zA-Z_]+) %[%d+%] купил дом ID: (%d+) по гос%. цене за (%S+) ms!")
	if hPl and hId and hTm then 
		for _, nick in pairs(cfg.ignore) do
			if hPl == nick then
				if bl_inchat.v then
					sampAddChatMessage(tag.."Дом "..mc..hId..wc.." был куплен игроком из игнор-листа", mcx)
					return { 0xAFAFAFFF, msg }
				end
				return false
			end
		end

		if isMe(hPl) then
			return { clr, msg .. yc .. " | Куплено вами" }
		end

		for k, v in pairs(PrRender["houses"]) do
			if tonumber(v[1]) == tonumber(hId) then
				table.remove(PrRender["houses"], k)
			end
		end

		writeOffLog(string.format("%s | Дом №%s, Словил: %s за %ssec\n", os.date("%d.%m %H:%M", os.time()), hId, hPl, hTm))

		table.insert(tLog, 1, { 1, os.time(), msg, {hPl, hId, hTm}, {false, nil, nil} } )
		if tonumber(ajailStatus) then 
			local getDelay = ajail_typeDelay.v == 1 and getRandomDelay(1000, 3000) or ajail_Delay.v
			table.insert(tAjail, { 1, {hPl, hId, hTm}, getDelay }) 
			return {clr, msg..yc.." | Авто-Режим"}
		else
			sampAddChatMessage(tag.."Запросить опровержение на дом "..hId..": "..lc.."/"..cfg.cmd.house, mcx)
			if sounds.v and hs_House then setAudioStreamState(hs_House, as.PLAY) end
		end
	end

-->> CARS BLOCK | [A] Nick_Name[777] поймал т/с VAZ 2108 | Цена: $100000 | В госе: 122.54 ms | Салон: Эконом.
	local cPl, cCar, cSum, cTime, cSal = msg:match("^%[A%] ([a-zA-Z_]+)%[%d+%] поймал т/с (.+) | Цена: %$(%d+) | В госе: ([0-9%.]+) ms | Салон: ([^%.]+)")
	if cSal == nil then
		cPl, cCar, cSum, cSal = msg:match("^%[A%] ([a-zA-Z_]+)%[%d+%] купил транспорт по госу (.+), цена: %$(%d+), салон: ([^%.]+)")
	end
	if cSal ~= nil then
		msg = string.gsub(msg, "В госе: ([0-9%.]+) ms", function(sec)
			sec = tonumber(sec)
			if sec ~= nil then
				if sec < 60 then
					return string.format("В госе: %d сек.", sec)
				elseif sec < 3600 then
					return os.date('В госе: %M:%S', sec)
				end
				return os.date('В госе: Более часа', sec)
			end
		end)

		for _, nick in pairs(cfg.ignore) do
			if cPl == nick then
				if bl_inchat.v then
					sampAddChatMessage(tag.."Транспорт был куплен игроком из игнор-листа", mcx)
					return { 0xAFAFAFFF, msg }
				end
				return false
			end
		end

		if isMe(cPl) then 
			return { clr, msg .. yc .. " | Куплено вами" } 
		end

		cTime = tonumber(cTime)
		writeOffLog(string.format("%s | Авто %s, Словил: %s\n", os.date("%d.%m %H:%M", os.time()), cCar, cPl))
		table.insert(tLog, 1, { 2, os.time(), msg, {cPl, cCar, cSum, cSal, cTime}, {false, nil, nil} } )

		local bSalon = checkSalon(cSal)
        if ajail_veh.v and bSalon and (cTime == nil or cTime <= carTimerMax.v) then
			local delay = (ajail_typeDelay.v == 1) and getRandomDelay(1000, 3000) or ajail_Delay.v
			lua_thread.create(function()
				wait(delay)
				local command = getJailCmd(2, tLog[1][4])
				sampSendChat(command)
			end)
			return { clr, msg .. yc .. " | Авто-Режим" }
		else
			sampAddChatMessage(tag.."Запросить опровержение на транспорт «".. cCar .."»: ".. lc .."/".. cfg.cmd.car, mcx)
			if sounds.v and hs_Car then setAudioStreamState(hs_Car, as.PLAY) end
			if not bSalon then 
				msg = msg:gsub(cSal, yc .. "%1")
			elseif ajail_veh.v and cTime ~= nil and cTime > carTimerMax.v then
				msg = msg .. "{AAAAAA} | Skip (> " .. carTimerMax.v .. " sec)"
			end
			return { clr, msg }
		end
	end

-->> BUSINESSES BLOCK | Nick_Name [777] купил бизнес ID: 123 по гос. цене за 2.28 ms!
	local bPl, bId, bTm = msg:match("^([a-zA-Z_]+) %[%d+%] купил бизнес ID: (%d+) по гос%. цене за (%S+) ms!")
	if bPl and bId and bTm then 
		for _, nick in pairs(cfg.ignore) do
			if bPl == nick then
				if bl_inchat.v then
					sampAddChatMessage(tag.."Бизнес "..mc..bId..wc.." был куплен игроком из игнор-листа", mcx)
					return { 0xAFAFAFFF, msg }
				end
				return false
			end
		end

		if isMe(bPl) then
			return { clr, msg .. yc .. " | Куплено вами" }
		end

		for k, v in pairs(PrRender["bizs"]) do
			if tonumber(v[1]) == tonumber(bId) then
				table.remove(PrRender["bizs"], k)
			end
		end

		writeOffLog(string.format("%s | Бизнес №%s, Словил: %s за %ssec\n", os.date("%d.%m %H:%M", os.time()), bId, bPl, bTm))

		table.insert(tLog, 1, { 3, os.time(), msg, {bPl, bId, bTm}, {false, nil, nil} } )
		if tonumber(ajailStatus) then 
			local getDelay = ajail_typeDelay.v == 1 and getRandomDelay(1000, 3000) or ajail_Delay.v
			table.insert(tAjail, { 3, {bPl, bId, bTm}, getDelay }) 
			return {clr, msg..yc.." | Авто-Режим"}
		else
			sampAddChatMessage(tag.."Запросить опровержение на бизнес "..bId..": "..lc.."/"..cfg.cmd.business, mcx)
			if sounds.v and hs_Biz then setAudioStreamState(hs_Biz, as.PLAY) end
		end
	end

-->> Jail
	local admin, victim, tj = msg:match("Администратор ([a-zA-Z_]+).* посадил игрока ([a-zA-Z_]+).* в деморган на %d+ минут")
	for k, box in pairs(tLog) do
		if box[4][1] == victim then 
			tLog[k][5][1], tLog[k][5][2], tLog[k][5][3] = true, tostring(admin), os.time()
		end
	end

	local adminoff, tjoff, victimoff = msg:match("Администратор ([A-z_]+) установил в оффлайне (%d+) минут деморгана игроку ([0-9A-z_]+)%.") 
	for k, box in pairs(tLog) do
		if box[4][1] == victimoff then 
			tLog[k][5][1], tLog[k][5][2], tLog[k][5][3] = true, tostring(adminoff), os.time()
		end
	end

-->> Unjail
	local adminunj, victimunj = msg:match("Администратор ([a-zA-Z_]+) выпустил игрока ([a-zA-Z_]+)")
	if adminunj and victimunj then
		for k, box in pairs(tLog) do
			if box[4][1] == victimunj then
				tLog[k][5][1], tLog[k][5][2], tLog[k][5][3] = false, tostring(adminunj), os.time()
			end
		end
	end

	local adminunjoff, victimunjoff = msg:match("Администратор ([a-zA-Z_]+) выпустил в оффлайне с деморгана ([a-zA-Z_]+)")
	if adminunjoff and victimunjoff then
		for k, box in pairs(tLog) do
			if box[4][1] == victimunjoff then
				tLog[k][5][1], tLog[k][5][2], tLog[k][5][3] = false, tostring(adminunjoff), os.time()
			end
		end
	end

-->> Триггер для авто-режима [Propery]
	if ajail_prop.v then 
		if msg:match("^__________Банковский чек__________$") or msg:match("^%[Ошибка%] {FFFFFF}Для получения PayDay вы должны отыграть минимум 20 минут") then
			if not isGamePaused() then
				ajailStatus, ajStart, tAjail = ajail_Time.v, os.time(), {}
			else
				sampShowDialog(5454, mc.."ROZOV OPROCHKI | "..wc.."Оповещение", wc.."Автоматический режим не был включен в пей-дей\nиз-за того что вы были в АФК", mc.."Понял", _, 0)
			end
		end
	end

-->> Check Admin-Authorization
	if not aAuth.state and aAuth.await then 
		if string.find(msg, "^%[Ошибка%] {%x+}Используй: /flip %[id%]") then 
			log("Проверка доступа к админке прошла "..lc.."успешно!")
			aAuth.await = false
			aAuth.state = true
			return false
		end
	end

-->> Cl-Check
	if awaitClAnswer then 
		local tStatus = {
		   ["неофициального клиента"] = "{FF0000}Клиент",
		   ["PC Launcher'a"] = "{00FF00}Лаунчер",
		   ["Mobile Launcher'a"] = "{FFFF00}Мобайл"
		}
		local nick, status = msg:match("^Игрок ([0-9A-z_]+)%[%d+%] подключен с {%x+}(.+)")
		if nick and status then 
			for k, v in pairs(tStatus) do 
				if status:find(k, 1, true) and tChecked[nick] then
					tChecked[nick][1] = v
					if lastOnTurnCl and lastOnTurnCl == nick then 
						awaitClAnswer = false
					end
				end
			end
			return false
		end

		if msg:match("%[Ошибка%] {FFFFFF}Игрок не в сети") then
			lua_thread.create(function()
				wait(0); awaitClAnswer = false
			end)
			return false
		end
	end

-->> No accept
	if msg:find("Наблюдается попытка взлома") then
		if tonumber(ajailStatus) then 
			ajailStatus = nil
			sampAddChatMessage(tag.."Автоматический режим недоступен из-за отсутствия аццепта!", mcx)
		end
	end
end

function sampGetAllTextlabels()
	local tdts = {}
	local pTt = sampGetTextlabelPoolPtr() + 59392
	for i = 0, 2047 do
		if readMemory(pTt + i * 4, 4) ~= 0 then
			table.insert(tdts, i)
		end
	end
	return tdts
end

function bizOwnerIdThread()
	tb3d = {}
	while true do wait(0)
		if bizOwnerId.v then
			for _, id3d in ipairs(sampGetAllTextlabels()) do
				local text = select(1, sampGet3dTextInfoById(id3d))
				if text then
					local clr, owner = text:match("Тип бизнеса: {FFFFFF}.+\n({......})Владелец: {FFFFFF}([A-z_]+)\n")
					if clr and owner then
						local result, playerId = getPlayerIdByNickname(owner)
						if result then
							local text = text:gsub(owner, owner..clr.." ["..playerId.."]")
							sampSet3dTextString(id3d, text)
							table.insert(tb3d, {id3d, playerId, text })
						end
					end
				end
			end
		end
		if #tb3d > 0 then
			for k, v in ipairs(tb3d) do
				if sampIs3dTextDefined(v[1]) then
					if not bizOwnerId.v or not sampIsPlayerConnected(v[2]) then
						local info = v[3]:match("Владелец: {FFFFFF}[A-z_]+({......} %[%d+%])\n")
						if info then 
							local info = info:gsub("%[", "%%[") or info:gsub("%]", "%%]")
							local text = v[3]:gsub(info, "")
							sampSet3dTextString(v[1], text)
						end
						table.remove(tb3d, k)
					end
				else
					table.remove(tb3d, k)
				end
			end
		end
	end
end

function getPlayerIdByNickname(name)
	for i = 0, 1000 do
		if sampIsPlayerConnected(i) then
			if sampGetPlayerNickname(i):lower() == tostring(name):lower() then 
				return true, i 
			end
		end
	end
	return false
end

function se.onShowDialog(dialogId, style, title, b1, b2, text)
-->> Hook houses
	if text:match("Используйте {1EA3CC}/findihouse ID{FFFFFF}, чтобы найти нужный вам дом") then
		PrRender["houses"] = {}
		for line in text:gmatch("[^\r\n]+") do
			local hId = line:match("ID: {C9B931}(%d+){FFFFFF}\t%[{A9FF14}Слетел{FFFFFF}%]")
			if hId and checkIgnoreHome(hId) then
				table.insert(PrRender["houses"], { hId })
			end
		end
		if PrRender["process"] then
			PrRender["process"] = false
			sampSendDialogResponse(dialogId, 1, -1, nil)
			return false
		end
	end

-->> Hook bizs
	if text:match("Используйте {1EA3CC}/findibiz ID{FFFFFF}, чтобы найти нужный вам бизнес") then
		PrRender["bizs"] = {}
		for line in text:gmatch("[^\r\n]+") do
			local bId, bName = line:match("ID: {C9B931}(%d+){FFFFFF}\t%[{A9FF14}Слетел{FFFFFF}%]\tТип: {C9B931}(.+){FFFFFF}")
			if bId and bName and checkIgnoreBiz(bId) then
				table.insert(PrRender["bizs"], { bId, bName })
			end
		end
		if PrRender["process"] then
			PrRender["process"] = false
			sampSendDialogResponse(dialogId, 1, -1, nil)
			return false
		end
	end

-->> Hook apanel-authorization
	if not aAuth.state then 
		if dialogId == 211 and aAuth.await then
			aAuth.await = false
			sampAddChatMessage(tag .. "Для полного доступа к скрипту авторизуйтесь в " .. lc .. "/apanel", mcx)
			sampSendDialogResponse(dialogId, 0, -1, nil)
			return false
		end
	end
end

