function ajailThread()
	while true do wait(0)
		AJTimer.v = ajailStatus and true or false
		if tonumber(ajailStatus) then
			local timeToEnd = ajailStatus - (os.time() - ajStart)
			if timeToEnd <= 0 then
				sampAddChatMessage(tag.."Время работы автоматического режима истекло", mcx)
				ajailStatus = nil 
			end
			if isGamePaused() and not isPauseMenuActive() then
				ajailStatus = nil 
				while isGamePaused() do wait(0) end
				sampShowDialog(5454, mc.."ROZOV OPROCHKI | "..wc.."Оповещение", wc.."Автоматический режим  на недвижимость был отключен из-за сворачивания игры", mc.."Понял", _, 0)
			end
			if #tAjail > 0 then 
				lua_thread.create(function()
					local tInfoAjail = tAjail[1]
					table.remove(tAjail, 1)
					wait(tInfoAjail[3])
					sampSendChat(getJailCmd(tInfoAjail[1], tInfoAjail[2]))
				end)
			end
		end 
	end
end

