function blicking(speed)
	local p = math.floor(math.sin(os.clock() * speed) * 127 + 128)
	local argb = 0
	local argb = bit.bor(argb, bit.lshift(255, 8))
	local argb = bit.bor(argb, bit.lshift(0, 16))
	local argb = bit.bor(argb, bit.lshift(p, 24))
	return argb
end

-->> OTHER FUNCTIONS
	function loadConfig()
		if not doesFileExist("moonloader/config/OpraSettings.ini") then
			inicfg.save(cfg, "OpraSettings.ini")
			log("Файл с настройками "..ec.."отсутствует!"..wc.." Создан новый!")
		end
		return true
	end

	function sampIsNickNameConnected(nick)
		local me = select(2, sampGetPlayerIdByCharHandle(playerPed))
		for i = 0, sampGetMaxPlayerId(false) do
			if sampIsPlayerConnected(i) or i == me then
				if sampGetPlayerNickname(i) == nick then return true, i end
			end
		end
		return false
	end

	function loadCmd()
		sampRegisterChatCommand("opra", function() ImOpra.v = not ImOpra.v end)

		sampRegisterChatCommand(cfg.cmd.house, goHouse)
		sampRegisterChatCommand(cfg.cmd.car, goCar)
		sampRegisterChatCommand(cfg.cmd.business, goBiz)
		sampRegisterChatCommand(cfg.cmd.ch, chouse)
		sampRegisterChatCommand(cfg.cmd.cb, cbiz)

		sampRegisterChatCommand("ajail", ajail)
		sampRegisterChatCommand("tpslet", tpslet)
		return true
	end

