	function imgui.SelButton(bool, name, wide)
		local animTime = 0.25
		local drawList = imgui.GetWindowDrawList()
		local p1 = imgui.GetCursorScreenPos()
		local p2 = imgui.GetCursorPos()
		imgui.PushStyleColor(imgui.Col.Button, imgui.ImVec4(0.98, 0.43, 0.26, 0.80))
		imgui.PushStyleColor(imgui.Col.ButtonHovered, imgui.ImVec4(0.98, 0.43, 0.26, 0.80))
		imgui.PushStyleColor(imgui.Col.ButtonActive, imgui.ImVec4(0.98, 0.43, 0.26, 0.80))
		local button = imgui.InvisibleButton(name, imgui.ImVec2(wide, 35))
		if button and not bool then navigateLast = os.clock() end
		local pressed = imgui.IsItemActive()
		imgui.PopStyleColor(3)
		if bool then
			if navigateLast and (os.clock() - navigateLast) < animTime then
				local wide = (os.clock() - navigateLast) * (wide / animTime)
				drawList:AddRectFilled(imgui.ImVec2(p1.x, p1.y), imgui.ImVec2((p1.x + wide) - wide, p1.y + 35), 0x10FFFFFF)
				drawList:AddRectFilled(imgui.ImVec2(p1.x, p1.y), imgui.ImVec2(p1.x + wide, p1.y + 35), mcx)
				drawList:AddRectFilled(imgui.ImVec2(p1.x, p1.y), imgui.ImVec2(p1.x + 5, p1.y + 35), 0xFF00FF00)
			else
				drawList:AddRectFilled(imgui.ImVec2(p1.x, p1.y), imgui.ImVec2(p1.x + wide, p1.y + 35), mcx)
				drawList:AddRectFilled(imgui.ImVec2(p1.x, (pressed and p1.y + 3 or p1.y)), imgui.ImVec2(p1.x + 5, (pressed and p1.y + 32 or p1.y + 35)), 0xFF00FF00)
			end
		else
			if imgui.IsItemHovered() then
				drawList:AddRectFilled(imgui.ImVec2(p1.x, p1.y), imgui.ImVec2(p1.x + wide, p1.y + 35), 0x10FFFFFF)
			end
		end
		imgui.SameLine(10); imgui.SetCursorPos(imgui.ImVec2((wide - imgui.CalcTextSize(name).x) / 2, p2.y + 8))
		imgui.Text(name)
		imgui.SetCursorPosY(p2.y + 40)
		return button
	end

	function imgui.CustomBarLogs()
		local pos = imgui.GetCursorScreenPos()
		local winWide = imgui.GetWindowWidth() - 44
		local drawList = imgui.GetWindowDrawList()

		local count = #logBut["buttons"]
		local butWide = winWide / count
		local height = 20
		local animTime = 0.2
		local sel = logBut["selected"]

		drawList:AddRectFilled(imgui.ImVec2(pos.x - 1, pos.y - 1), imgui.ImVec2(pos.x + winWide + 1, pos.y + height + 1), 0xFF191919, 6)
		drawList:AddRect(imgui.ImVec2(pos.x - 1, pos.y - 1), imgui.ImVec2(pos.x + winWide + 1, pos.y + height + 1), mcx, 6)
		
		local renderButton = function(n, color)
			if n == 1 then
				drawList:AddRectFilled(imgui.ImVec2(pos.x + (butWide * n) - butWide, pos.y), imgui.ImVec2(pos.x + (butWide * n), pos.y + height), color, 5, 9)
			elseif n == count then
				drawList:AddRectFilled(imgui.ImVec2(pos.x + (butWide * n) - butWide, pos.y), imgui.ImVec2(pos.x + (butWide * n), pos.y + height), color, 5, 6)
			else
				drawList:AddRectFilled(imgui.ImVec2(pos.x + (butWide * n) - butWide, pos.y), imgui.ImVec2(pos.x + (butWide * n), pos.y + height), color)
			end
		end
		local smooth = function(color)
			local s = function(f)
				return f < 0 and 0 or (f > 255 and 255 or f)
			end
			local _, r, g, b = explode_U32(color)
			local a = s((os.clock() - logBut["clicked"]["time"]) * (128 / animTime))
			return join_argb(a, r, g, b)
		end
		if logBut["clicked"]["time"] and os.clock() - logBut["clicked"]["time"] < 0.4 then
			renderButton(sel, smooth(mcx))
		else
			renderButton(sel, mcx)
		end
		imgui.PushStyleVar(imgui.StyleVar.FrameRounding, 5)
		imgui.PushStyleVar(imgui.StyleVar.ItemSpacing, imgui.ImVec2(0, 4))
		imgui.PushStyleColor(imgui.Col.Button, imgui.ImVec4(0.00, 0.00, 0.00, 0.00))
		imgui.PushStyleColor(imgui.Col.ButtonHovered, imgui.ImVec4(0.00, 0.00, 0.00, 0.00))
		imgui.PushStyleColor(imgui.Col.ButtonActive, imgui.ImVec4(0.00, 0.00, 0.00, 0.00))
		for i, button in ipairs(logBut["buttons"]) do
			if imgui.Button(u8(button .. "##" .. i), imgui.ImVec2(butWide, height)) then
				if logBut["selected"] ~= i then
					log_full = {}
					logBut["clicked"]["last"] = logBut["selected"]
					logBut["clicked"]["time"] = os.clock()
					logBut["selected"] = i
				end
			end
			if i ~= count then
				imgui.SameLine()
			end
		end
		imgui.PopStyleColor(3)
		imgui.PopStyleVar(2)
		imgui.SameLine(nil, 10)
		imgui.TextColored(imgui.ImVec4(0.3, 1.0, 0.3, 1.0), fa.ICON_FA_UNDO)
		if imgui.IsItemClicked() then log_full = {} end
		imgui.Hint("refresh_offlog", u8"Обновить данные")
		imgui.SetCursorPosY(30 + 5)
	end

	function sendOnfootSync(x, y, z)
		local almem = allocateMemory(68)
		local selfId = select(2, sampGetPlayerIdByCharHandle(playerPed))
		sampStorePlayerOnfootData(selfId, almem)
		setStructFloatElement(almem, 6, x, false)
		setStructFloatElement(almem, 10, y, false)
		setStructFloatElement(almem, 14, z, false)
		sampSendOnfootData(almem)
		setStructElement(almem, 4, 4, 1024, false)
		sampSendOnfootData(almem)
		freeMemory(almem)
	end

