	function popupChangeCommand()
		if imgui.BeginPopupModal(u8"Изменение команды", _, imgui.WindowFlags.NoCollapse + imgui.WindowFlags.NoResize + imgui.WindowFlags.AlwaysAutoResize) then
			imgui.CenterTextColoredRGB("Введите новую команду")
			if imgui.InputText("##ChangeCommand", ImChCmd, imgui.InputTextFlags.EnterReturnsTrue) then 
				local new_cmd = u8:decode(ImChCmd.v)

				if string.len(new_cmd) > 1 and string.find(new_cmd, "^/") then
					local cmd_text = string.gsub(new_cmd, "/", "")
					if string.match(cmd_text, "^%s") then
						sampAddChatMessage(tag .. "Команда не может начинаться с пробела!", mcx)
						imgui.SetKeyboardFocusHere()
					else
						local funcs = { 
							["house"] = goHouse,
							["car"] = goCar,
							["business"] = goBiz,
							["ch"] = chouse,
							["cb"] = cbiz
						}

						for name, command in pairs(cmd) do
							if chCmd == name then
								if sampRegisterChatCommand(cmd_text, funcs[name]) then
									sampUnregisterChatCommand(cfg.cmd[name])
									cfg.cmd[name] = cmd_text
									cmd[name].v = u8(new_cmd)
									sampAddChatMessage(tag.."Команда изменена!", mcx)
								elseif new_cmd ~= cmd[name].v then
									sampAddChatMessage(tag.."Не удалось создать команду! Возможно такая команда уже используется чем-то другим!", mcx)
								end
							end
						end
						imgui.CloseCurrentPopup()
					end
				else
					imgui.SetKeyboardFocusHere()
				end
			end

			local cmd = u8:decode(cmd[chCmd].v)
			if string.len(cmd) <= 0 then
				imgui.CenterTextColoredRGB("{FF0000}Нельзя оставлять пустым!")
			elseif string.find(cmd, "^/.+") then
				imgui.CenterTextColoredRGB("Нажмите " .. lc .. "«Enter»{SSSSSS} чтобы сохранить")
			else
				imgui.CenterTextColoredRGB("{FF0000}Неверный формат команды!")
			end
			imgui.EndPopup()
		end
	end

	function getJailCmd(jtype, tBox)
		local bonl, _ = sampIsNickNameConnected(tBox[1])
		local template = u8:decode(reason[jtype].v)
		if jtype == 1 or jtype == 3 then
			local template = template:gsub("{id}", tBox[2])
			local template = template:gsub("{time}", tBox[3])
			return string.format("/jail%s %s %s %s", (bonl and "" or "off"), tBox[1], jailTime.v, template)
		else
			local template = template:gsub("{car}", tBox[2])
			local template = template:gsub("{time}", tBox[5])
			local template = template:gsub("{salon}", tBox[4])
			return string.format("/jail%s %s %s %s", (bonl and "" or "off"), tBox[1], jailTime.v, template)
		end
	end

	function updateDate()
		local strDate = thisScript().description
		local d, m, y = strDate:match("(%d+)%.(%d+)%.(%d+)")
		local tDateUpdate = { 
			year = y,
			month = m,
			day = d
		}
		return getStrDate(os.time(tDateUpdate))
	end

	function daysAfterUpdate()
		local strDate = thisScript().description
		local d, m, y = strDate:match("(%d+)%.(%d+)%.(%d+)")
		local tDateUpdate = { 
			year = y,
			month = m,
			day = d
		}
		local tDateNow = {
			year = os.date("%Y", os.time()),
			month = os.date("%m", os.time()),
			day = os.date("%d", os.time())
		}
		return math.floor((os.time(tDateNow) - os.time(tDateUpdate)) / 86400)
	end

	function isVersionCurrent(strVer)
		local cur = thisScript().version:match("^(%d+%.%d+).+")
		local new = strVer:match("^(%d+%.%d+).+")
		return cur == new
	end

	function isVersionBeta(strVer)
		local sel_g, sel_v, sel_p = strVer:match("(%d+)%.(%d+)%.(%d+).*")
		local now_g, now_v, now_p = thisScript().version:match("(%d+)%.(%d+)%.(%d+).*")
		return tonumber(tostring(sel_g..sel_v..sel_p)) > tonumber(tostring(now_g..now_v..now_p))
	end

	function getStrDate(unixTime)
		local tMonths = {"января", "февраля", "марта", "апреля", "мая", "июня", "июля", "августа", "сентября", "октября", "ноября", "декабря"}
		local day = tonumber(os.date("%d", unixTime))
		local month = tMonths[tonumber(os.date("%m", unixTime))]
		local year = tonumber(os.date("%Y", unixTime))
		return string.format("%s %s %s", day, month, year)
	end

