	function imgui.TestSound(var, count)
		if var:match("^http%a*://.+%.mp3$") then
			if count == 1 then 
				if var == cfg.opra.sound_h then 
					if imgui.Button("Play##house", imgui.ImVec2(70, 20)) then
						setAudioStreamState(hs_House, as.PLAY) 
					end
				else
					if imgui.Button("Load##house", imgui.ImVec2(70, 20)) then
						hs_House = loadAudioStream(tostring(var))
						if hs_House then
							cfg.opra.sound_h = sound["house"].v
							setAudioStreamState(hs_House, as.PLAY)
						else
							sampAddChatMessage(tag.."Такого звука не существует либо ссылка не корректная!", mcx) 
							sound["house"].v = ""
						end
					end
				end
			end
			if count == 2 then 
				if var == cfg.opra.sound_c then 
					if imgui.Button("Play##car", imgui.ImVec2(70, 20)) then
						setAudioStreamState(hs_Car, as.PLAY) 
					end
				else
					if imgui.Button("Load##car", imgui.ImVec2(70, 20)) then
						hs_Car = loadAudioStream(tostring(var))
						if hs_Car then
							cfg.opra.sound_c = sound["car"].v
							setAudioStreamState(hs_Car, as.PLAY)
						else
							sampAddChatMessage(tag.."Такого звука не существует либо ссылка не корректная!", mcx) 
							sound["car"].v = ""
						end
					end
				end
			end
			if count == 3 then 
				if var == cfg.opra.sound_b then 
					if imgui.Button("Play##biz", imgui.ImVec2(70, 20)) then
						setAudioStreamState(hs_Biz, as.PLAY) 
					end
				else
					if imgui.Button("Load##biz", imgui.ImVec2(70, 20)) then
						hs_Biz = loadAudioStream(tostring(var))
						if hs_Biz then
							cfg.opra.sound_b = sound["biz"].v
							setAudioStreamState(hs_Biz, as.PLAY)
						else
							sampAddChatMessage(tag.."Такого звука не существует либо ссылка не корректная!", mcx) 
							sound["biz"].v = ""
						end
					end
				end
			end
		else
			imgui.DisableButton("Play", imgui.ImVec2(70, 20))
			imgui.Hint("play_sound", u8("Неверно указана ссылка на звук, или вовсе отсутствует\nСсылка должна выглядеть в следующем формате:\nhttps://www.myinstants.com/media/sounds/bruh.mp3"))
			if count == 1 then hs_House = nil end
			if count == 2 then hs_Car = nil end
			if count == 3 then hs_Biz = nil end
		end
	end

	function checkSalon(salonName)
		for name, _ in pairs(cfg.salons_filter) do 
			if tostring(salonName) == tostring(name) then 
				return salons_filter[name].v
			end
		end
		return false
	end

	function inputHintsForCommand()
		if sampIsChatInputActive() and not tonumber(ajailStatus) then
			local inputText = sampGetChatInputText()
			local strEl = getStructElement(sampGetInputInfoPtr(), 0x8, 4)
			local Y = getStructElement(strEl, 0xC, 4) + 12.5

			if inputText:match("^/".. cfg.cmd.house .."%s*$") then 
				local blast, keybox, boxlast = getLastByed(1)
				if blast then
					local isOnline, playerId = sampIsNickNameConnected(boxlast[4][1])
					local getOnline = isOnline and "("..playerId..")" or ec.." [OFF]{00C235}"
