	function getDialogQacc(checkJail, boolRepeat)
		if boolRepeat == nil then boolRepeat = false end
		local repeatMsg = boolRepeat and "\n"..ec.."Не так быстро!" or ""
		sampShowDialog(5000, mc.."Подтверждение действия", string.format("%sПроверьте правильность команды:\n%s%s%s", wc, lc, checkJail, repeatMsg), mc.."Jail!", mc.."Отмена", 0)
		local goQaccTimer = os.clock()
		lua_thread.create(function()
			while true do wait(0)
				if sampGetCurrentDialogId() == 5000 then 
					local result, button, list, input = sampHasDialogRespond(5000)
					if result then
							if button == 1 then
								if os.clock() - goQaccTimer > 1.0 then
									sampSendChat(checkJail)
								else
									getDialogQacc(checkJail, true)
								end
							else
								sampAddChatMessage(tag.."Отменено", mcx)
							end
						break
					end
				end
			end
		end)
	end

