	function imgui.Hint(str_id, hint, delay, width)
		local hovered = imgui.IsItemHovered()
		local col = imgui.ImVec4(0.67, 1.00, 0.00, 1.00)
		local animTime = 0.2
		local delay = delay or 0.00
		local show = true

		if not allHints then allHints = {} end
		if not allHints[str_id] then
			allHints[str_id] = {
				status = false,
				timer = 0
			}
		end

		if hovered then
			for k, v in pairs(allHints) do
				if k ~= str_id and os.clock() - v.timer <= animTime  then
					show = false
				end
			end
		end

		if show and allHints[str_id].status ~= hovered then
			allHints[str_id].status = hovered
			allHints[str_id].timer = os.clock() + (hovered == false and 0.00 or delay)
		end

		local showHint = function(text, alpha, max_width)
			imgui.PushStyleVar(imgui.StyleVar.Alpha, alpha)
			imgui.PushStyleVar(imgui.StyleVar.WindowRounding, 5)
			imgui.PushStyleVar(imgui.StyleVar.WindowPadding, imgui.ImVec2(10, 10))
			imgui.PushStyleColor(imgui.Col.PopupBg, imgui.ImVec4(0.15, 0.15, 0.15, 1.00))
			imgui.BeginTooltip()
				imgui.PushTextWrapPos(max_width or 450)
				imgui.TextColored(imgui.ImVec4(col.x, col.y, col.z, 1.00), fa.ICON_FA_INFO_CIRCLE..u8" Подсказка:")
				imgui.PushStyleVar(imgui.StyleVar.ItemSpacing, imgui.ImVec2(0, 0))
				imgui.TextColoredRGB(u8:decode(text))
				imgui.PopStyleVar()
				imgui.PopTextWrapPos()
			imgui.EndTooltip()
			imgui.PopStyleColor()
			imgui.PopStyleVar(3)
		end

		if show then
			local btw = os.clock() - allHints[str_id].timer
			if btw <= animTime then
				local s = function(f) 
					return f < 0.0 and 0.0 or (f > 1.0 and 1.0 or f)
				end
				local alpha = hovered and s(btw / animTime) or s(1.00 - btw / animTime)
				showHint(hint, alpha, width)
			elseif hovered then
				showHint(hint, 1.00, width)
			end
		end
	end

	function clMarkerThread()
		tChecked = {}
		while true do wait(0)
			if clMarker.v then 
				local peds = getAllChars()
				for _, ped in ipairs(peds) do
					if ped ~= playerPed then
						local cX, cY, cZ = getCharCoordinates(ped)
						local playerId = select(2, sampGetPlayerIdByCharHandle(ped))
						if sampIsPlayerConnected(playerId) and sampGetPlayerScore(playerId) > 0 then
							local nickName = sampGetPlayerNickname(playerId)
							if playerIsNotChecked(tChecked, nickName) then 
								awaitClAnswer = true
								lastOnTurnCl = nickName
								tChecked[nickName] = {"Неизвестно", ped}
								sampSendChat("/cl "..nickName)
							end
						end
					end
				end
				for k, v in pairs(tChecked) do 
					if doesCharExist(v[2]) then
						if isCharOnScreen(v[2]) then
							local myX, myY, myZ = getCharCoordinates(playerPed)
							local x, y, z = getCharCoordinates(v[2])
							if getDistanceBetweenCoords3d(myX, myY, myZ, x, y, z) <= 50 then
								local sx, sy = convert3DCoordsToScreen(x, y, z)
								renderFontDrawTextAlign(fontCl, v[1], sx, sy, -1, 2)
							end
						end
					else
						tChecked[k] = nil
					end
				end                
			end
		end
	end

	function playerIsNotChecked(t, nick)
		for k, _ in pairs(t) do 
			if k == nick then 
				return false
			end
		end
		return true
	end

