		local r = math.floor(math.sin(os.clock() * speed) * 127 + 128) / 255
		local g = math.floor(math.sin(os.clock() * speed + 2) * 127 + 128) / 255 
		local b = math.floor(math.sin(os.clock() * speed + 4) * 127 + 128) / 255
		return r, g, b, 1
	end

