	function imgui.TextColoredRGB(text)
		local style = imgui.GetStyle()
		local colors = style.Colors
		local ImVec4 = imgui.ImVec4

		local explode_argb = function(argb)
			local a = bit.band(bit.rshift(argb, 24), 0xFF)
			local r = bit.band(bit.rshift(argb, 16), 0xFF)
			local g = bit.band(bit.rshift(argb, 8), 0xFF)
			local b = bit.band(argb, 0xFF)
			return a, r, g, b
		end

		local getcolor = function(color)
			if color:sub(1, 6):upper() == "SSSSSS" then
				local r, g, b = colors[1].x, colors[1].y, colors[1].z
				local a = tonumber(color:sub(7, 8), 16) or colors[1].w * 255
				return ImVec4(r, g, b, a / 255)
			end
			local color = type(color) == "string" and tonumber(color, 16) or color
			if type(color) ~= "number" then return end
			local r, g, b, a = explode_argb(color)
			return imgui.ImColor(r, g, b, a):GetVec4()
		end

		local render_text = function(text_)
			for w in text_:gmatch("[^\r\n]+") do
				local text, colors_, m = {}, {}, 1
				w = w:gsub("{(......)}", "{%1FF}")
				while w:find("{........}") do
					local n, k = w:find("{........}")
					local color = getcolor(w:sub(n + 1, k - 1))
					if color then
						text[#text], text[#text + 1] = w:sub(m, n - 1), w:sub(k + 1, #w)
						colors_[#colors_ + 1] = color
						m = n
					end
					w = w:sub(1, n - 1) .. w:sub(k + 1, #w)
				end
				if text[0] then
					for i = 0, #text do
						imgui.TextColored(colors_[i] or colors[1], u8(text[i]))
						imgui.SameLine(nil, 0)
					end
					imgui.NewLine()
				else imgui.Text(u8(w)) end
			end
		end
		render_text(text)
	end

	function imgui.CenterTextColoredRGB(text)
		local width = imgui.GetWindowWidth()
		local style = imgui.GetStyle()
		local colors = style.Colors
		local ImVec4 = imgui.ImVec4

		local explode_argb = function(argb)
			local a = bit.band(bit.rshift(argb, 24), 0xFF)
			local r = bit.band(bit.rshift(argb, 16), 0xFF)
			local g = bit.band(bit.rshift(argb, 8), 0xFF)
			local b = bit.band(argb, 0xFF)
			return a, r, g, b
		end

		local getcolor = function(color)
			if color:sub(1, 6):upper() == "SSSSSS" then
				local r, g, b = colors[1].x, colors[1].y, colors[1].z
				local a = tonumber(color:sub(7, 8), 16) or colors[1].w * 255
				return ImVec4(r, g, b, a / 255)
			end
			local color = type(color) == "string" and tonumber(color, 16) or color
			if type(color) ~= "number" then return end
			local r, g, b, a = explode_argb(color)
			return imgui.ImColor(r, g, b, a):GetVec4()
		end

		local render_text = function(text_)
			for w in text_:gmatch("[^\r\n]+") do
				local textsize = w:gsub("{.-}", "")
				local text_width = imgui.CalcTextSize(u8(textsize))
				imgui.SetCursorPosX( width / 2 - text_width .x / 2 )
				local text, colors_, m = {}, {}, 1
				w = w:gsub("{(......)}", "{%1FF}")
				while w:find("{........}") do
					local n, k = w:find("{........}")
					local color = getcolor(w:sub(n + 1, k - 1))
					if color then
						text[#text], text[#text + 1] = w:sub(m, n - 1), w:sub(k + 1, #w)
						colors_[#colors_ + 1] = color
						m = n
					end
					w = w:sub(1, n - 1) .. w:sub(k + 1, #w)
				end
				if text[0] then
					for i = 0, #text do
						imgui.TextColored(colors_[i] or colors[1], u8(text[i]))
						imgui.SameLine(nil, 0)
					end
					imgui.NewLine()
				else
					imgui.Text(u8(w))
				end
			end
		end
		render_text(text)
	end

	function imgui.MiniLable(text, clr, offsx, offsy)
		local dList = imgui.GetWindowDrawList()
		local p = imgui.GetCursorScreenPos()
		local textsize = imgui.CalcTextSize(text)
		dList:AddRect(imgui.ImVec2((p.x + offsx) - 10, p.y), imgui.ImVec2((p.x + offsx + textsize.x) + 10, p.y + (offsy * 2)), imgui.GetColorU32(clr), 16.0)
		local p_ = imgui.GetCursorPos()
		imgui.SetCursorPos(imgui.ImVec2(p_.x + offsx, p_.y + (offsy - 7.5)))
		imgui.TextColored(clr, text) 
	end

function imgui.ToggleButton(str_id, bool)
	local rBool = false

	if LastActiveTime == nil then
		LastActiveTime = {}
	end
	if LastActive == nil then
		LastActive = {}
	end

	local function ImSaturate(f)
		return f < 0.0 and 0.0 or (f > 1.0 and 1.0 or f)
	end
	
	local p = imgui.GetCursorScreenPos()
	local draw_list = imgui.GetWindowDrawList()

	local height = imgui.GetTextLineHeightWithSpacing()
	local width = height * 1.60
	local radius = height * 0.50
	local ANIM_SPEED = 0.15
	local butPos = imgui.GetCursorPos()

	if imgui.InvisibleButton(str_id, imgui.ImVec2(width, height)) then
		bool.v = not bool.v
		rBool = true
		LastActiveTime[tostring(str_id)] = os.clock()
		LastActive[tostring(str_id)] = true
	end

	imgui.SetCursorPos(imgui.ImVec2(butPos.x + width + 8, butPos.y + 2.5))
	imgui.Text( str_id:gsub("##.+", "") )

	local t = bool.v and 1.0 or 0.0

	if LastActive[tostring(str_id)] then
		local time = os.clock() - LastActiveTime[tostring(str_id)]
		if time <= ANIM_SPEED then
			local t_anim = ImSaturate(time / ANIM_SPEED)
			t = bool.v and t_anim or 1.0 - t_anim
		else
			LastActive[tostring(str_id)] = false
		end
	end

	local col
	local col_static = imgui.GetColorU32(imgui.GetStyle().Colors[imgui.Col.WindowBg])
	if bool.v then
		col = imgui.GetColorU32(imgui.GetStyle().Colors[imgui.Col.Button])
	else
		col = imgui.GetColorU32(imgui.ImVec4(0.40, 0.40, 0.40, 1.00))
	end

	draw_list:AddRectFilled(imgui.ImVec2(p.x, p.y + (height / 6)), imgui.ImVec2(p.x + width - 1.0, p.y + (height - (height / 6))), col, 5.0)
	draw_list:AddCircleFilled(imgui.ImVec2(p.x + radius + t * (width - radius * 2.0), p.y + radius), radius - 0.75, col_static)
	draw_list:AddCircle(imgui.ImVec2(p.x + radius + t * (width - radius * 2.0), p.y + radius), radius - 0.75, col, 32, 2)

	return rBool
end

function explode_U32(u32)
	local a = bit.band(bit.rshift(u32, 24), 0xFF)
	local r = bit.band(bit.rshift(u32, 16), 0xFF)
	local g = bit.band(bit.rshift(u32, 8), 0xFF)
	local b = bit.band(u32, 0xFF)
	return a, r, g, b
end

function join_argb(a, r, g, b)
	local argb = b
	argb = bit.bor(argb, bit.lshift(g, 8))
	argb = bit.bor(argb, bit.lshift(r, 16))
	argb = bit.bor(argb, bit.lshift(a, 24))
	return argb
end

function loadPatches()
	-- Изменения при первом запуске (Обычно после обновления скрипта)
	if cfg.opra.launch_count <= 0 then
		if string.find(cfg.opra.reason_c, "{sum}", 1, true) then
			cfg.opra.reason_c = "Опру т/с «{car}»"
			reason[2].v = u8(cfg.opra.reason_c)
		end
		
		local any_sound_change = false 
		if string.find(cfg.opra.sound_h, "201159__kiddpark__cash-register.mp3", 1, true) then
			cfg.opra.sound_h = "https://www.myinstants.com/media/sounds/in_call_notify_d3dba3973359ac82666f4532a7806b51.mp3"
			sound.house.v = u8(cfg.opra.sound_h)
			any_sound_change = true
		end
		if string.find(cfg.opra.sound_c, "toasty_tfCWsU6.mp3", 1, true) then
			cfg.opra.sound_c = "https://www.myinstants.com/media/sounds/notify.mp3"
			sound.car.v = u8(cfg.opra.sound_c)
			any_sound_change = true
		end
		if string.find(cfg.opra.sound_b, "fail-sound-effect.mp3", 1, true) then
			cfg.opra.sound_b = "https://www.myinstants.com/media/sounds/in_call_notify_d3dba3973359ac82666f4532a7806b51.mp3"
			sound.biz.v = u8(cfg.opra.sound_b)
			any_sound_change = true
		end

		if any_sound_change then
			loadSounds()
		end
	end
	cfg.opra.launch_count = cfg.opra.launch_count + 1


	-- Прочие изменения при каждом запуске
	if cfg.opra.ajail_Delay < 1000 then 
		cfg.opra.ajail_Delay = 1000 
		ajail_Delay.v = cfg.opra.ajail_Delay
	end
end

